/**
 * <p>cc.LoaderScene is a scene that you can load it when you loading files</p>
 * <p>cc.LoaderScene can present thedownload progress </p>
 * @class
 * @extends cc.Scene
 * @example
 * var lc = new cc.LoaderScene();
 */

bgData = "data:image/jpg;base64,"
	king_1 = "data:image/jpg;base64,"
		king_2 = "data:image/jpg;base64,"
			progress = "data:image/jpg;base64,"
				progressTo = "data:image/jpg;base64,"
					GameLoading = cc.Scene.extend({
	_interval : null,
	_label : null,
	_className:"LoaderScene",
	_king1:null,
	_king2:null,
	_progress:null,
	_progressTo:null,
	/**
	 * Contructor of cc.LoaderScene
	 * @returns {boolean}
	 */
	init : function(){
		var self = this;

		//logo
		var logoWidth = 160;
		var logoHeight = 200;

		// bg
		var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(255, 255, 255, 255));
		
		bgLayer.setPosition(cc.visibleRect.bottomLeft);
		self.addChild(bgLayer, 0);

		//image move to CCSceneFile.js
		var fontSize = 12, lblHeight =  -logoHeight / 2 + 100;
		/*if(cc._loaderImage){
			//loading logo
			cc.loader.loadImg(logoData, {isCrossOrigin : false }, function(err, img){
				logoWidth = img.width;
				logoHeight = img.height;
				self._initStage(img, cc.visibleRect.center);
			});
			fontSize = 14;
			lblHeight = -logoHeight / 2 - 10;
		}*/
		//loading percent
		var winsize = cc.director.getWinSize();
		var label = self._label = new cc.LabelTTF("0%", "Arial", fontSize);
		label.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, lblHeight)));
		label.setColor(cc.color(255, 255, 255));
		label.y = winsize.height / 2 - 40;
		bgLayer.addChild(this._label, 10);
		
		//
		
		cc.loader.loadImg(bgData, {isCrossOrigin : false }, function(err, img){
			var texture2d = self._texture2d = new cc.Texture2D();
			texture2d.initWithElement(img);
			texture2d.handleLoadedTexture();
			var bg = new cc.Sprite(texture2d);
			var winsize = cc.director.getWinSize();
			var centerpos = cc.p(winsize.width / 2, winsize.height / 2);
			bg.setPosition(centerpos);
			self._bgLayer.addChild(bg);
		});
		
		
		
		cc.loader.loadImg(progress, {isCrossOrigin : false }, function(err, img){
			var texture2d = self._texture2d = new cc.Texture2D();
			texture2d.initWithElement(img);
			texture2d.handleLoadedTexture();
			self._progress = new cc.Sprite(texture2d);
			var winsize = cc.director.getWinSize();
			var centerpos = cc.p(150, winsize.height / 2);
			self._progress.setPosition(cc.p(winsize.width / 2, winsize.height / 2 - 25));
			self._bgLayer.addChild(self._progress);
		});
		
		cc.loader.loadImg(progressTo, {isCrossOrigin : false }, function(err, img){
			var texture2d = self._texture2d = new cc.Texture2D();
			texture2d.initWithElement(img);
			texture2d.handleLoadedTexture();
			self._progressTo = new cc.ProgressTimer(new cc.Sprite(texture2d));
			var winsize = cc.director.getWinSize();
			self._progressTo.type = cc.ProgressTimer.TYPE_BAR;
			self._progressTo.midPoint = cc.p(0, 1);
			self._progressTo.barChangeRate = cc.p(1, 0);
			self._progressTo.percentage = 0;
			self._progressTo.setPosition(cc.p(winsize.width / 2, winsize.height / 2 - 25));
			self._bgLayer.addChild(self._progressTo);
		});
		cc.loader.loadImg(king_1, {isCrossOrigin : false }, function(err, img){
			var texture2d = self._texture2d = new cc.Texture2D();
			texture2d.initWithElement(img);
			texture2d.handleLoadedTexture();
			self._king1 = new cc.Sprite(texture2d);
			var winsize = cc.director.getWinSize();
			var centerpos = cc.p(100, winsize.height / 2);
			self._king1.setPosition(centerpos);
			self._bgLayer.addChild(self._king1);
		});

		cc.loader.loadImg(king_2, {isCrossOrigin : false }, function(err, img){
			var texture2d = self._texture2d = new cc.Texture2D();
			texture2d.initWithElement(img);
			texture2d.handleLoadedTexture();
			self._king2 = new cc.Sprite(texture2d);
			var winsize = cc.director.getWinSize();
			var centerpos = cc.p(150, winsize.height / 2);
			self._king2.setPosition(centerpos);
			self._bgLayer.addChild(self._king2);
			self._king2.visible = false;
		});
		this.schedule(this.switchKing, 0.5, 50, 0);
		return true;
	},
	
	switchKing: function () {
		if (this._king2.visible) {
			this._king2.visible = false;
			this._king1.visible = true;
		} else {
			this._king2.visible = true;;
			this._king1.visible = false;
		}
	},

	_initStage: function (img, centerPos) {
		var self = this;
		var texture2d = self._texture2d = new cc.Texture2D();
		texture2d.initWithElement(img);
		texture2d.handleLoadedTexture();
		var logo = self._logo = new cc.Sprite(texture2d);
		logo.setScale(cc.contentScaleFactor());
		logo.x = centerPos.x;
		logo.y = centerPos.y;
		self._bgLayer.addChild(logo, 10);
	},
	/**
	 * custom onEnter
	 */
	onEnter: function () {
		var self = this;
		cc.Node.prototype.onEnter.call(self);
		self.schedule(self._startLoading, 0.3);
	},
	/**
	 * custom onExit
	 */
	onExit: function () {
		cc.Node.prototype.onExit.call(this);
		var tmpStr = "0%";
		this._label.setString(tmpStr);
		this._progressTo.setPercentage(100);
	},

	/**
	 * init with resources
	 * @param {Array} resources
	 * @param {Function|String} cb
	 */
	initWithResources: function (resources, cb) {
		if(cc.isString(resources))
			resources = [resources];
		this.resources = resources || [];
		this.cb = cb;
	},

	_startLoading: function () {
		var self = this;
		self.unschedule(self._startLoading);
		var res = self.resources;
		
		cc.loader.load(res,
				function (result, count, loadedCount) {
			var percent = (loadedCount / count * 100) | 0;
			percent = Math.min(percent, 100);
			self._label.setString(percent + "%");
			self._progressTo.setPercentage(percent);
		}, function () {
			if (self.cb)
				self.cb();
		});
	}
});
/**
 * <p>cc.LoaderScene.preload can present a loaderScene with download progress.</p>
 * <p>when all the resource are downloaded it will invoke call function</p>
 * @param resources
 * @param cb
 * @returns {cc.LoaderScene|*}
 * @example
 * //Example
 * cc.LoaderScene.preload(g_resources, function () {
       cc.director.runScene(new HelloWorldScene());
   }, this);
 */
GameLoading.preload = function(resources, cb){
	cc.log("GameLoading");
	var _cc = cc;
	if(!_cc.loaderScene) {
		_cc.loaderScene = new GameLoading();
		_cc.loaderScene.init();
	}
	_cc.loaderScene.initWithResources(resources, cb);

	cc.director.runScene(_cc.loaderScene);
	return _cc.loaderScene;
};